import React, { useState } from 'react';
import styled from 'styled-components';

const ButtonContainer = styled.div`
  display: flex;
  gap: 1rem;
  margin-top: 1rem;
`;

const FacultyButton = styled.button`
  padding: 0.5rem 1rem;
  font-size: 1rem;
  background-color: #333;
  color: #fff;
  border: none;
  border-radius: 5px;
  cursor: pointer;
`;

const FacultyButtons = () => {
  const [showButtons, setShowButtons] = useState(false);

  const handleFacultyClick = () => {
    setShowButtons(!showButtons);
  };

  return (
    <div>
      <FacultyButton onClick={handleFacultyClick}>Faculty Of IT</FacultyButton>
      <FacultyButton onClick={handleFacultyClick}>Faculty Of Pharmacry</FacultyButton>
      <FacultyButton onClick={handleFacultyClick}>Faculty Of Media</FacultyButton>

      {showButtons && (
        <ButtonContainer>
          {/* Place your different buttons here */}
          <button>Button A</button>
          <button>Button B</button>
          <button>Button C</button>
        </ButtonContainer>
      )}
    </div>
  );
};

export default FacultyButtons;
